    "        \n",
    "        # gt_depths = F.one_hot(gt_depths.long(),\n",
    "        #                       num_classes=2).view(\n",
    "        #                           -1, 2)[:, 1:]\n",
    "        \n",
    "\n",
    "        return gt_depths.long().float() , zero_mask"
